//     return (
//         <div style={{ position: 'relative' }}>
//             <Techstack></Techstack>
//             <Techstack newoffset={windowSize * 0.13}></Techstack>
//             <Techstack newoffset={windowSize * 0.26}></Techstack>
//             <Techstack newoffset={windowSize * 0.39}></Techstack>
//             <Techstack newoffset={windowSize * 0.52}></Techstack>
//             <Techstack newoffset={windowSize * 0.65}></Techstack>
//         </div>
//     );
// }

function Script(props) {
    return (
        <div className="home_script">
            <h1>{props.title}</h1>
            <p>{props.scripts}</p>
            <a className={props.styleType} href={props.link} >{props.hname}</a>
        </div>
    );

}

function Image(props) {
    return (
        <div className="home_image">
            <img src={props.source}></img>
        </div>
    );
}

function Button(props) {
    return (
        <div className="home_button">
            <input type="button">{props.value}</input>
        </div>
    );
}

export default Home;
